import React from "react";
function Monitor(prop){
    const boxzz=prop.monitor;
    console("monitors"+boxzz);
    return(
        <div>
            Monitor
            {
            boxzz.map((item,index) => {
                return(
                    <span key={index} style={{"background":"green"}} className="boxzz"></span>
                )
            }
         
            )}
        </div>
    )
}
export default Monitor;
